import styled from "styled-components";

export const FixFooter = styled.div`
  bottom: 0;
`;

export const Container = styled.div`
  margin-top: 5%;
`;

export const H1 = styled.h1`
  color: white;
  margin-left: 2%;
  padding-bottom: 1%;
  font-size: 2em;
  font-family: "Source Sans Pro", sans-serif;
`;

export const Div = styled.div`
  display: flex;
  flex-wrap: nowrap;
  overflow-x: scroll;
`;
